DROP TABLE IF EXISTS Language;

CREATE TABLE Language 
(
ID INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, 
NativeText NVARCHAR(254),
De NVARCHAR(254),
En NVARCHAR(254),
Fr NVARCHAR(254),
Sp NVARCHAR(254),
Ru NVARCHAR(254)
);




CREATE TABLE IF NOT EXISTS Parameter  
(
ID INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, 
Parameter NVARCHAR(254),
Value NVARCHAR(254),
Comment NVARCHAR(254)
);


SELECT 'Language','De','System'
WHERE NOT EXISTS(SELECT 1 FROM Parameter WHERE Parameter = 'Language');

CREATE TABLE IF NOT EXISTS Errors  
(
ID INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, 
InComing  timestamp,
OutGoing  timestamp,
VisuSymbol NVARCHAR(20)
);


DROP TABLE IF EXISTS Plcitems;

CREATE TABLE Plcitems 
(
ID INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, 
S7Adress NVARCHAR(20),
S7Symbol NVARCHAR(20),
S7SymbolType NVARCHAR(10),
S7Comment NVARCHAR(150),
SymbolType NVARCHAR(150),
Column NVARCHAR(10),
RankingGroup NVARCHAR(150),
GroupComment NVARCHAR(150),
RankingSymbol NVARCHAR(150),
Comment NVARCHAR(150),
Unit NVARCHAR(150),
SymbolFormat NVARCHAR(150),
UpperLimit NVARCHAR(150),
LowerLimit NVARCHAR(150),
UserRightEnable NVARCHAR(150),
UserRightVisible NVARCHAR(150),
VisuSymbol NVARCHAR(20)
);



INSERT 
INTO Language (nativetext)
SELECT DISTINCT 
Plcitems.Comment AS NativeText
FROM         
Plcitems 
LEFT OUTER JOIN
Language 
ON 
Plcitems.Comment = Language.NativeText
WHERE     
Language.NativeText IS NULL
go

INSERT 
INTO Language (nativetext)
SELECT DISTINCT 
Plcitems.GroupComment AS NativeText
FROM         
Plcitems 
LEFT OUTER JOIN
Language 
ON 
Plcitems.GroupComment = Language.NativeText
WHERE     
Language.NativeText IS NULL
go

update language set de=nativetext where de is null
go
update language set sp=nativetext where sp is null
go
update language set fr=nativetext where fr is null
go
update language set en=nativetext where en is null
go
update language set ru=nativetext where ru is null
go
